import { 
  RECEIVE_SELECTED_ASSET, 
  // CHECK_IN_SELECTED_ASSET_SUCCESS,
  // CHECK_OUT_SELECTED_ASSET_SUCCESS
} from "./asset.actions";

const INITIAL_STATE = {
}

// eslint-disable-next-line import/no-anonymous-default-export
const assetData = (state = INITIAL_STATE  , { type, assetData }) => {
  switch (type) {
    case RECEIVE_SELECTED_ASSET:
      return assetData;
    // case CHECK_IN_SELECTED_ASSET_SUCCESS:
    //   return state
    // case CHECK_OUT_SELECTED_ASSET_SUCCESS:
    //   return state
    default:
      return state;
  }
};

export default assetData;
